from typing import List
'''
1330. 翻转子数组得到最大的数组值
https://leetcode.cn/problems/reverse-subarray-to-maximize-array-value/

化简问题+分类讨论
略
'''
class Solution:
    def maxValueAfterReverse(self, nums: List[int]) -> int:
        res = 0
        minus = 0
        a, b = -100000, 100000
        for i in range(len(nums) - 1):
            res += abs(nums[i] - nums[i + 1])
        for i in range(1, len(nums) - 1):
            minus = max(minus, -abs(nums[i] - nums[i - 1]) + abs(nums[i] - nums[0]))
            minus = max(minus, -abs(nums[i] - nums[i + 1]) + abs(nums[i] - nums[-1]))
            x, y = nums[i], nums[i + 1]
            a = max(a, min(x, y))
            b = min(b, max(x, y))
        a = max(a, min(nums[0], nums[1]))
        b = min(b, max(nums[0], nums[1]))
        return res + max(minus, 2 * (a - b))

